import { useState } from "react";

function Digit({ value, enterDigit }) {
    return <button class="digit" onClick={enterDigit}>{value}</button>
}

function Row({ digits }) {
    return (
        <>
            <div class="board-row">
                <Digit value={7} enterDigit={() => setEquation(equation + '' + 7)}></Digit>
                <Digit></Digit>
                <Digit></Digit>
            </div>
        </>
    )
}

export default function Calculator() {

    const [equation, setEquation] = useState("");

    return (
        <>
            <input type="text" value={equation} onChange={e => setEquation(e.target.value)} />
            <div class="board-row">
                <Digit value={7} enterDigit={() => setEquation(equation + '' + 7)}></Digit>
                <Digit value={8}></Digit>
                <Digit value={9}></Digit>
            </div>
            <div class="board-row">
                <Digit value={4}></Digit>
                <Digit value={5}></Digit>
                <Digit value={6}></Digit>
            </div>
            <div class="board-row">
                <Digit value={1}></Digit>
                <Digit value={2}></Digit>
                <Digit value={3}></Digit>
            </div>
        </>
    );
}
